// SPDX-License-Identifier: MIT
// https://docs.openzeppelin.com/contracts/4.x/wizard
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";

import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";

import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721URIStorageUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/extensions/ERC721EnumerableUpgradeable.sol";


import "./lib/LibPart.sol";


contract Paru721V2 is
    ERC721Upgradeable,
    ERC721URIStorageUpgradeable,
    ERC721EnumerableUpgradeable,
    AccessControlUpgradeable,
    PausableUpgradeable
{
    using SafeMath for uint256;
    bytes32 public constant BURNER_ROLE = keccak256("BURNER_ROLE");
    string private _baseUri;

    event RoyaltySet(uint256 tokenId, LibPart.Part[] royalty);
    event RoyaltyOwnerSet(uint256 tokenId, address owner);

    // ownerble upgradeable
    mapping(uint256 => LibPart.Part[]) _royalties;
    mapping(uint256 => address) _royaltyOwners;

    function initialize(
        string memory _name,
        string memory _symbol,
        string memory _baseuri
    ) external initializer {
        __ERC721Enumerable_init_unchained();
        __ERC721URIStorage_init_unchained();
        __ERC721_init_unchained(_name, _symbol);
        _setBaseURI(_baseuri);
    }

    /*
     * bytes4(keccak256('getRoyalties(LibAsset.AssetType)')) == 0x44c74bcc
     */
    bytes4 constant _INTERFACE_ID_ROYALTIES = 0x44c74bcc;

    /**
     * @dev Mints a token to an address with a tokenURI.
     * @param _to address of the future owner of the token
     */
    function mintItem(address _to, string memory _uri) public {
        uint256 newTokenId = _getNextTokenId();
        _mint(_to, newTokenId);
        _setTokenURI(newTokenId, _uri);
        // approvalForAll for reduce user's gas??
    }

    function mintItemWithRoyalty( // AndApprove?
        address _to,
        string memory _uri,
        address royaltyOwner,
        LibPart.Part[] memory royalties
    ) public {
        uint256 newTokenId = _getNextTokenId();
        _mint(_to, newTokenId);
        _setTokenURI(newTokenId, _uri);
        _setRoyaltyOwner(newTokenId, royaltyOwner);
        _setRoyalties(newTokenId, royalties);
    }

    // update - setRoyalty
    function updateRoyalty(uint256 tokenId, LibPart.Part[] memory royalties)
        external
    {
        require(
            msg.sender == getRoyaltyOwner(tokenId),
            "PARU721: updateRoyalty message sender is not royaltyOwner"
        );
        require(
            _exists(tokenId),
            "PARU721: updateRoyalty query for nonexistent token"
        );
        _setRoyalties(tokenId, royalties);
    }

    // transfer - setRoyaltyOwner
    function transferRoyaltyOwnership(uint256 tokenId, address to) external {
        require(
            msg.sender == getRoyaltyOwner(tokenId),
            "PARU721: transferRoyaltyOwnership message sender is not royaltyOwner"
        );
        require(
            _exists(tokenId),
            "PARU721: transferRoyaltyOwnership query for nonexistent token"
        );
        _setRoyaltyOwner(tokenId, to);
    }


    function getRoyalties(uint256 tokenId)
        public
        view
        returns (LibPart.Part[] memory)
    {
        return _royalties[tokenId];
    }

    function _setRoyalties(uint256 tokenId, LibPart.Part[] memory royalties)
        internal
    {
        // clear existence
        delete _royalties[tokenId];
        // validate and save
        for (uint256 i = 0; i < royalties.length; i++) {
            require(
                royalties[i].account != address(0x0),
                "PARU721: _setRoyalties, Recipient should be present"
            );
            require(
                royalties[i].value > 0 && royalties[i].value < 501,
                "PARU721: _setRoyalties, Royalty value should be range in 1~500"
            );
            _royalties[tokenId].push(royalties[i]);
        }

        emit RoyaltySet(tokenId, royalties);
    }

    function getRoyaltyOwner(uint256 tokenId) public view returns (address) {
        return _royaltyOwners[tokenId];
    }

    function _setRoyaltyOwner(uint256 tokenId, address owner) internal {
        require(owner != address(0x0), "PARU721: _setRoyaltyOwner, Recipient should be present");
        _royaltyOwners[tokenId] = owner;

        emit RoyaltyOwnerSet(tokenId, owner);
    }

    function _getNextTokenId() private view returns (uint256) {
        return totalSupply().add(1);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    )
        internal
        override(ERC721EnumerableUpgradeable, ERC721Upgradeable)
        whenNotPaused
    {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function _burn(uint256 tokenId)
        internal
        override(ERC721Upgradeable, ERC721URIStorageUpgradeable)
    {
        require(hasRole(BURNER_ROLE, _msgSender()));
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721Upgradeable, ERC721URIStorageUpgradeable)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function _setBaseURI(string memory _baseuri) internal virtual {
        _baseUri = _baseuri;
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _baseUri;
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(
            ERC721Upgradeable,
            AccessControlUpgradeable,
            ERC721EnumerableUpgradeable
        )
        returns (bool)
    {
        return
            interfaceId == _INTERFACE_ID_ROYALTIES ||
            super.supportsInterface(interfaceId);
    }
}
